import React from "react";
import Solution from "../Solution";
import {
	WrapperBottomSections,
	TitleSection,
	WrapperSolutions,
} from "./styles";

class BottomSections extends React.Component {
	render() {
		return (
			<WrapperBottomSections>
				<TitleSection>One product, three solutions</TitleSection>
				<WrapperSolutions>
					<Solution TitleInfo="Roadmap to succes"> </Solution>
					<Solution TitleInfo="Goals that matter"> </Solution>
					<Solution> </Solution>
				</WrapperSolutions>
			</WrapperBottomSections>
		);
	}
}

export default BottomSections;
